SELECT COUNT(*) FROM client JOIN account ON client.client_id = account.client_id JOIN branch ON account.branch_code = branch.branch_code WHERE branch.city = 'Jesenik' AND client.gender = 'F'
SELECT T2.disposition_id FROM trans AS T1 JOIN account AS T2 ON T1.account_id = T2.account_id WHERE T1.trans_date = '1998-09-02' AND T1.amount = 5100;
SELECT COUNT(*) FROM account WHERE opened="1996" AND A2="Litomerice" ;
SELECT T3.district FROM client AS T1 JOIN account AS T2 ON T1.account_id = T2.account_id JOIN branch AS T3 ON T2.branch_id = T3.branch_id WHERE T1.gender = 'F' AND T1.date_of_birth = '1976-01-29'
SELECT(SELECT T4.birthday FROM account AS T1 JOIN savings_account AS T2 ON T1.account_id =  T2.account_id JOIN loan AS T3 ON T1.client_id = T3.client_id JOIN client AS T4 ON T3.client_id = T4.client_id WHERE amount  =  "98832" AND loan_start_date LIKE "196%/1/3") AS T5;
SELECT T1.account_id FROM ACCOUNT AS T1 JOIN branch AS T2 ON T1.branch_id = T2.id WHERE T2.place_name_en = 'Prague' ORDER BY account_opening_date ASC LIMIT 1
SELECT CAST(SUM(IIF(T2.gender = 'M', 1 ,0 )) AS REAL) * 100 / COUNT(T2.custumer_id) FROM branch AS T1 JOIN customer AS T2 ON T1.branch_ID = T2.branch_id WHERE T1.region_name = "South Bohemia" AND T1.inhabitants = ( SELECT MAX(inhabitants) FROM branch WHERE region_name = "South Bohemia" )
SELECT CAST((SUM(IIF(T2.date<='1998-12-27' AND T2.date>='1993-03-22', T2.amount, 0)) - SUM(IIF(T2.date <= '1993-03-22', T2.amount, 0))) AS REAL) / SUM(IIF(T2.date <= '1993-03-22', T2.amount, 0)) * 100 FROM client AS T1 JOIN trans AS T2 ON T1.account_id = T2.account_id JOIN loan AS T3 ON T1.client_id = T3.client_id WHERE T3.date = '1993-07-05' AND T3.date_contract = (SELECT MIN(date_contract) FROM loan WHERE strftime('%Y', date_contract) = '1993')
SELECT CAST(SUM(IIF(status = 'A', amount, 0)) AS REAL) * 100 / SUM(amount) FROM loan;
SELECT CAST(SUM(IIF(T2.status = 'C', 1, 0)) AS REAL) * 100 / COUNT(*) FROM `loan` AS T1 INNER JOIN `contract` AS T2 ON T1.`contract_id` = T2.`contract_id` WHERE T1.amount <= 100000
SELECT T1.account_id, T2.name, T2.region FROM account AS T1 JOIN accountholder AS T2 ON T1.client_district = T2.district JOIN trans AS T3 ON T1.account_id = T3.account_id WHERE strftime('%Y',T3.date) = '1993' AND type = 'POPLATEK PO OBRATU'
SELECT T2.TID ,  count(T1.freq) FROM Statement AS T1 JOIN Account AS T2 ON T1.account_id = T2.account_id WHERE T2.birth_date BETWEEN '1995' AND '2000' AND area = "East Bohemia" GROUP BY T2.account_ID
SELECT T1.account_id ,  T1.open_date FROM account AS T1 JOIN city AS T2 ON T1.city_code  =  T2.city_code WHERE T2.district_code = 'A2' ;
SELECT T1.district ,  T1.region FROM customer AS T1 JOIN loan AS T2 ON T1.cust_id = T2.cust_id WHERE T2.loan_id = 4990;
SELECT T1.acc_id ,  T1.district ,  T1.region FROM loan_status AS T1 JOIN loans AS T2 ON T2.loan_status_id = T1.loan_code WHERE loan_amount > 300000 AND currency = "USD" GROUP BY account_id HAVING MIN(loan_amnt) > max_int_rate
SELECT T.loan_id, T.district, T2 avg_salary FROM (SELECT T1.loan_id, T1.region_code as district FROM loan AS T1 WHERE T1.duration = 60) AS T INNER JOIN (SELECT region_code, AVG(avg_salary) AS avg_salary FROM bank GROUP BY region_code) AS T2 ON T.district = T2.region_code
SELECT T5.district ,  100 * (T5.A13 - T5.A12) / T5.A12 FROM loan AS T1 INNER JOIN client AS T2 ON T1.client_id = T2.client_id INNER JOIN branch AS T3 ON T1.branch_id = T3.branch_id INNER JOIN district AS T4 ON T3.district_id = T4.district_id INNER JOIN unemployment AS T5 ON T4.cd = T5.state WHERE T1.status = 'D' AND 1996 BETWEEN T1.begin_time_year AND T1.end_time_year OR 1995 BETWEEN T1.begin_time_year AND T1.end_time_year GROUP BY T5.district
SELECT CAST(SUM(IIF(T1.city_district_id  = ( SELECT `city_district_id` FROM city_district WHERE name_en  =  'Decin' ) , 1 , 0 )) AS REAL) * 100 / COUNT(T1.`account_id`) FROM `account` AS T1 INNER JOIN owner AS T2 ON T1.owner_id  =  T2.owner_id WHERE strftime('%Y',T1.opened_date)  =  '1993'
SELECT account_id FROM fee WHERE f_description = 'POPLATEK MESICNE'
SELECT T1.district FROM a1 AS T1 JOIN account AS T2 ON T1.account_id = T2.district WHERE T2.gender = "F" GROUP BY T1.district ORDER BY COUNT(T1.account_id) DESC LIMIT 9
SELECT T4.a2 FROM trans AS T1 JOIN loan AS T2 ON T1.account_id = T2.account_id JOIN customer AS T3 ON T3.customer_id = T2.client_id JOIN adresa AS T4 ON T4.adresa_id = T3.adresa_id WHERE T4.a2 != '' AND date LIKE '1996-01%' AND type = 'VYDAJ' ORDER BY amount DESC LIMIT 10
SELECT COUNT (*) FROM accounts WHERE region = ( SELECT id FROM a3 WHERE name_region == 'South Bohemia' ) AND  NOT exists( SELECT * FROM credit WHERE holder == accounts.id) ;
SELECT T2.city FROM bank AS T1 JOIN branch AS T2 ON T1.broker_id = T2.broker_id JOIN loan AS T3 ON T2.branch_id = T3.branch_id WHERE T3.status = 'C' OR  T3.status = 'D' GROUP BY T2.city ORDER BY COUNT(*) DESC LIMIT 1
SELECT AVG(t2.amount) FROM account AS t1 JOIN loan AS t2 ON t1.account_id = t2.account_id WHERE t1.gender = 'M'
SELECT T2.branch_location ,  T1.district FROM District AS T1 JOIN bank AS T2 ON T1.id  =  T2.branch_district ORDER BY T1.unemploy_96 DESC LIMIT 1;
SELECT T1.account_count FROM branch AS T1 JOIN ( SELECT branch_id ,  MAX(t3.a16) AS Maxcrime ,  1996 AS YEAR FROM(SELECT t1.branch_name ,  t1.Branch_ID ,  count(t2.client_id) as a13 , 1993 AS year UNION SELECT  t1.branch_name,  t1.Branch_ID ,   count(t2.client_id) AS a98 , 1997 AS year) AS t3 GROUP BY BRANCH_ID ) AS T2 ON T2.branch_id = T1.BRANCH_ID WHERE T2.year = 1996 AND T2.MaxCrime = T2.a16
SELECT COUNT(*) FROM credit_card_operation AS T1 JOIN transactions_operation AS T2 ON T1信用卡_transaction_id = T2.OPERATION UNION transactions_date BETWEEN  T3.date AND (date + INTERVAL  T2.freq  MONTH) WHERE Operation = "VYBER KARTOU" AND T.account_balance < 0 AND T2.FREQUENCY =  "POPLATEK MESICNE";
SELECT COUNT(*) FROM `loan` L WHERE Date_of_disbursal BETWEEN '1995-01-01' AND '1997-12-31' AND Amount >= 250000 AND EXISTS(SELECT 1 FROM `account_type_at_account` AA JOIN Account A ON AA.account_id = A.account_id WHERE L.Account_id2=A.id_account_type AND Frequency='Monthly')
SELECT COUNT(*) FROM account WHERE branch_id IN(SELECT * FROM(SELECT branch_id FROM branch_location WHERE city='1')as T) AND status IN('C','D') ;
SELECT COUNT(*) FROM ( SELECT * FROM client WHERE gender = 'M' AND branch_id IN ( SELECT branch_id FROM(SELECT * , RANK() OVER(ORDER BY a15 DESC) Rank FROM branch WHERE a15 != 0) WHERE rank = 2) GROUP BY customer_id )
SELECT COUNT(*) FROM Card WHERE card_type_code = "GOLD" AND card_disposition_code = "OWNER"
SELECT COUNT(*) FROM Account WHERE district_id = (SELECT district_id FROM District WHERE district_name = 'Pisek')
SELECT T1.name FROM district AS T1 JOIN bank AS T2 ON T1.did = T2.district_id JOIN trans AS T3 ON T3.account_id IN ( SELECT account_id FROM account WHERE branch_id IN ( SELECT branch_id FROM branches WHERE bank_id = T2.id ) ) WHERE strftime('%Y', T3.date) = '1997' GROUP BY T1.name HAVING SUM(T3.amount) > 10000
SELECT T2.account_id FROM order AS T1 JOIN trans AS T2 ON T2.account_id = T1.account_id WHERE T1.k_symbol = 'SIPO' AND T2.bank = 'Pisek';
SELECT `account_number` FROM `card` WHERE `card_type_code` = 'G' GROUP BY `account_id`
SELECT AVG(amount) FROM trans WHERE date BETWEEN '2021-01-01' AND '2021-12-31' AND operation = 'VYBER KARTOU' GROUP BY strftime('%m', date)
SELECT T2.account_holder  FROM trans AS T1 JOIN account AS T2 ON T1.account_id  =  T2.account_id WHERE date LIKE '1998%' AND type  =  'VYDANO' AND operation  =  'VYBER KARTOU' AND amount  <  (SELECT avg(amount) FROM trans WHERE date LIKE '1998%' AND type  =  'VYDANO' AND operation  =  'VYBER KARTOU') GROUP BY T2.account_holder LIMIT 1
SELECT T1.client_id FROM client AS T1 JOIN account AS T2 ON T1.client_id = T2.client_id WHERE T1.sex = 'F' AND T2.account_type = 'credit' INTERSECT SELECT T1.client_id FROM client AS T1 JOIN loan AS T2 ON T1.client_id = T2.client_id
