WITH CarbonAtoms AS (     SELECT a.molecule_id     FROM atom a      WHERE a.element = 'c' ), DoubleBondMolecules AS (     SELECT b.molecule_id     FROM bond b     WHERE b.bond_type = '=' ), MoleculeCarbonCount AS (     SELECT cab.molecule_id, COUNT(cab.molecule_id) as CarbonAtomCount     FROM CarbonAtoms cab      JOIN DoubleBondMolecules db ON cab.molecule_id = db.molecule_id     GROUP BY cab.molecule_id ), TotalAtomCounts AS (     SELECT a.molecule_id, COUNT(a.atom_id) AS TotalAtomCount     FROM atom a      JOINDoubleBondMolecules dmb ON a.molecule_id = dmb.molecule_id     GROUP BY a.molecule_id ) SELECT (CAST(AVG(CCC.CarbonAtomCount*1.0 / TAC.TotalAtomCount ) AS REAL) *100 )As CarbonPercentageInDoubleBondMolecules  FROM MoleculeCarbonCount CCC   JOINTotalAtomCountsTac ON CCC.Molecule_id=tac.molecule_id 
