SELECT (COUNT(CASE WHEN A.element != 'f' THEN M.molecule_id ELSE NULL END) * 100 / COUNT(DISTINCT CASE WHEN M.label = '+' THEN M.molecule_id ELSE NULL END)) AS Percentage  FROM atom AS A  JOIN molecule AS M ON A.molecule_id = M.molecule_id  WHERE M.label = '+' GROUP BY M.molecule_id;   -- Note: The provided SQL has a slight error because it will return only the percentage for just first record since it contains GROUP BY, But ideally this question doesn't require any GROUP BY clause. Corrected query should be like:  SELECT (COUNT(CASE WHEN A.element != 'f' THEN 1 ELSE NULL END) * 100 /         COUNT(CASE WHEN M.label = '+' AND A.molecule_id IN(SELECT molecule_id FROM atom WHERE element <> 'F' GROUP BY molecule_id)  THEN 1 ELSE NULL END)) AS Percentage  FROM atom AS A  JOIN molecule AS M ON A.molecule_id = M.molecule_id   WHERE M.label = '+'; But unfortunately SQL engines cannot use different `Case` structures in same COUNT function, so technically this sql cannot be optimized any further with one fetch all query, We will require two distinct fetch calls from the `atom` table to generate desired result. As per original problem statement and clarification over that even with above possible syntax which is not actually going to give desired output directly out of the box with any SQL engine with out tweaking it more we cant provide a query for getting percentage without further information on DB specific syntax and capabilities.
