SELECT T.Name FROM Posts P JOIN Posts AS Ps ON P.ParentId = Ps.Id JOIN PostTags PT ON Ps.Id = PT.PostId JOIN Tags T ON PT.TagId = T.Id WHERE P.OwnerUserId IN(SELECT Id FROM Users WHERE DisplayName='John Salvatier') GROUP BY T.Name ORDER BY COUNT(T.Name) DESC LIMIT 6
SELECT COUNT(*) FROM Posts WHERE OwnerUserId IN (SELECT Id FROM Users WHERE DisplayName = 'Daniel Vassallo');
SELECT COUNT(*) FROM votes WHERE UserId IN (SELECT Id FROM users WHERE DisplayName = 'Harlan')
SELECT P1.Id FROM Posts AS P1 INNER JOIN Users AS U ON U.Id = P1.OwnerUserId WHERE U.DisplayName = 'slashnick' AND AnswerCount IN ( SELECT MAX(AnswerCount) FROM Posts AS P2 INNER JOIN Users AS U2 ON U2.Id = P2.OwnerUserId WHERE U2.DisplayName = 'slashnick') LIMIT 1
SELECT MAX(SUM(p.ViewCount)) AS max_view_count, p.OwnerUserId, u.DisplayName FROM Posts p JOIN Users u ON p.OwnerUserId = u.Id WHERE u.DisplayName IN ('Harvey Motulsky', 'Noah Snyder') GROUP BY p.OwnerUserId, u.DisplayName;
SELECT COUNT(*) FROM posts WHERE Id IN (SELECT PostId FROM votes GROUP BY PostId HAVING COUNT(*) > 4) AND OwnerUserId IN(SELECT Id FROM Users WHERE DisplayName='Matt Parker')
SELECT COUNT(*) FROM Posts JOIN Comments ON Posts.Id = Comments.PostId WHERE Posts.OwnerUserId = (SELECT Id FROM Users WHERE DisplayName = 'Neil McGuigan') AND Comments.Score < -1;
SELECT Tags FROM Posts WHERE OwnerUserId IN (SELECT Id FROM Users WHERE DisplayName = 'Mark Meckes') AND CommentCount = 0;
SELECT T1.DisplayName FROM Users AS T1 JOIN Badge AS T2 ON T1.Id = T2.UserId WHERE T2.Name = 'Organizer' GROUP BY T1.DisplayName
SELECT CAST(SUM(IIF(T2.TagName = 'r', 1, 0)) AS REAL) * 100 / COUNT(T1.Id) FROM Posts AS T1 INNER JOIN PostTags AS T3 ON T1.Id = T3.PostId INNER JOIN Tags AS T2 ON T2.Id = T3.TagId WHERE T1.OwnerUserId IN (SELECT Id FROM Users WHERE DisplayName = 'Community')
