SELECT COUNT(*) ,  T1.forename ,  T1.surname FROM drivers AS T1 JOIN results AS T2 ON T1.driverid = T2.driverid WHERE T2.position = '1' ORDER BY T1.dob LIMIT 1;
SELECT MAX(Duration) FROM pitStops
SELECT MIN(`Time`) FROM `laps` WHERE 1=1
SELECT MAX(DURATION) FROM pitStops WHERE driverId = ( SELECT driverId FROM drivers WHERE code = "HAM" );
SELECT T5.stop FROM races AS T1 JOIN results AS T2 ON T1.raceId = T2.raceId JOIN drivers AS T3 ON T3.driverId = T2.driverId JOIN constructorResults AS T4 ON T2.resultId = T4.resultId JOIN driverStandings AS T5 ON T5.driverStandingId = T4.constructorId WHERE T1.year = 2011 AND T1.round = 1 AND T3.code = 'HAM' GROUP BY T5.stop LIMIT 1
SELECT lapTimes.driverId, lapTimes.raceId, lapTimes.milliseconds AS nextLapTime, nextLap.milliseconds AS followingNextLapTime, (nextLap.milliseconds - lapTimes.milliseconds) AS duration FROM lapTimes JOIN(SELECT * FROM lapTimes WHERE raceId = 18 AND (lap > (SELECT MIN(lap) from lapTimes))) AS nextLap ON nextLap.driverId = lapTimes.driverId AND nextLap.raceId = lapTimes.raceId AND nextLap.lap = lapTimes.lap + 1 WHERE lapTimes.raceId = 18 GROUP BY lapTimes.driverId, duration;
SELECT T2.fastestLapTime FROM drivers AS T1 JOIN results AS T2 ON T1.driverId = T2.driverId WHERE T1.forename = "Lewis" AND T1.surname = "Hamilton" ORDER BY milliseconds LIMIT 1
SELECT DISTINCT T1.forename, T1.surname FROM drivers AS T1 JOIN results AS T2 ON T1.driverid = T2.driverid WHERE T2.fastestlaptime = ( SELECT MIN(T3.fastestLapTime) FROM results AS T3 ) LIMIT 20;
SELECT T3.position FROM ( SELECT * FROM results AS T1 JOIN races AS T2 ON T1.raceid = T2.raceid WHERE T2.name LIKE '%Formula_1%' ) AS T3 JOIN drivers AS T4 ON T3.driverid = T4.driverid WHERE T4.forename = 'Lewis' AND T4.surname = 'Hamilton' ORDER BY T3.fastestlaptime LIMIT 1
SELECT TIME FROM results JOIN races ON results.raceId = races.raceId WHERE name='Austrian Grand Prix' ORDER BY Time LIMIT 1
SELECT T2.time FROM circuits AS T1 JOIN results AS T2 ON T1.circuitId = T2.position WHERE T1.country = "Italy" AND positionText = \"1\" GROUP BY Lap ORDER BY MIN(T2.milliseconds) LIMIT 1
SELECT R.raceName FROM results AS RES INNER JOIN races AS R ON RES.raceId = R.raceId WHERE RES.rank = 1 AND R.name = 'Austrian Grand Prix' GROUP BY R.raceName ORDER BY MIN(RES.fastestLapTime) LIMIT 1
SELECT T2.duration FROM.results AS T1 JOIN getPitStops AS T2 ON T1.raceId = T2.raceId AND T1.driverId = T2.driverId WHERE T1.time IN(SELECT MIN (T1.time) FROM.results AS T1 JOIN GETPITSTOPS AS T2 ON Ti.RACEID = T2.raceid AND 1.driverid = t2.driverid where raceName = "Austrian Grand Prix");
SELECT T2.lat, T2.long FROM results AS T1 JOIN circuits AS T2 ON T1.circuitid = T2.circuitid WHERE fastestLapTime = '1:29.488'
SELECT AVG(T2.milliseconds) FROM drivers AS T1 JOIN results AS T2 ON T1.driverId = T2.driverId WHERE T1.forename = "Lewis" AND T1.surname = "Hamilton";
SELECT AVG(T3.milliseconds) FROM countries AS T1 JOIN circuits AS T2 ON T1.country_id = T2.circuitId WHERE T1.name = "Italy" JOIN lapTimes AS T3 ON T3.raceId IN (SELECT raceId FROM races WHERE circuitId = T2.circuit_id);
SELECT api	id FROM Player WHERE overall_rating = (SELECT MAX(overall_rating) FROM Player)
SELECT T1.name FROM Player AS T1 JOIN PlayerInfo AS T2 ON T1.playerid = T2.id ORDER BY T2.height DESC LIMIT 1;
SELECT T1.Preferred_foot FROMPlayers AS T1 JOIN Player_Attributes AS T2 ON T1.player_api_id = T2.player_fifa_api_id WHERE T2.foot = 'right' AND T2.attacking_work_rate = 'high' ORDER BY T2.potential LIMIT 1
SELECT COUNT(*) FROM Player WHERE overall_rating BETWEEN 60 AND 65 AND defensive_work_rate = 'low'
SELECT T1.player_name, T2.crossing FROM player AS T1 JOIN player_attributes AS T2 ON T1 SoFIFA_id = T2.player_api_id WHERE T2.soFifa_status = 'crossing' ORDER BY crossing DESC LIMIT 5; SELECT player_id FROM(SELECT player_api_id, MAX(crossing) as max_crossing FROM `Player_Attributes` GROUP BY player_api_id ) AS PlayerSkills JOIN `Player` ON `Player`.player_API_ID =  PlayerSkills.player_Api_ID ORDER BY  PlayerSkills .max_ Crossing DESC LIMIT 5;
SELECT T2.Name , SUM(T1.home_team_goal + t1.away_team_goal) as total_goals FROM match AS T1 JOIN league AS T2 ON (T1.league_id  =  T2.league_id) WHERE T1.season = '2015/2016' GROUP BY T1.league_id ORDER BY total_goals DESC LIMIT 1
SELECT `homeTeam` FROM `Match` WHERE `date` LIKE '%2015%' AND `homeTeam Goals` < `awayTeam Goals` GROUP BY `homeTeam` ORDER BY COUNT(*) LIMIT 1
SELECT T1.player_name FROM `Player` AS T1 JOIN `Player_Statistics` AS T2 ON T1.id = T2.player_id ORDER BY T2.penalties DESC LIMIT 10
SELECT T1.team_long_name FROM Team AS T1 JOIN (     SELECT away_team_api_id, COUNT(*) as win_count FROM `Match`     WHERE league_id = (         SELECT id FROM League WHERE name = 'Scotland Premier League'     ) AND season = '2009/2010' GROUP BY away_team_api_id     HAVING SUM(awayTeamGoals - homeTeamGoals) > 0 ORDER BY win_count DESC LIMIT 1 ) AS T2 ON T1.team_api_id = T2.away_team_api_id
SELECT T3.buildUpPlaySpeed FROM (SELECT @rnk :=@rnk+1 as row_num, teamID FROM `Match`, (SELECT (@rnk :=0)) rnk GROUP BY team_id ORDER BY MIN(buildUpPlaySpeed) DESC LIMIT 4) AS t2 INNER JOIN Teams AS T3 ON T3.team_id = t2.teamid
SELECT League FROM match WHERE Match_season = '2015/2016' AND Home-team_goals = Away_team_score GROUP BY league ORDER BY COUNT(Match_ID) DESC LIMIT 1;
SELECT SUBSTR(T2.birthday, 1, 4) + (DATE('now') - STRFTIME('%Y', T2.birthday)) / CAST(SUBSTR(STRTIME('%Y', T2.birthday), 3) AS REAL) FROM Player_attributes AS T1 JOIN Player AS T2 ON T1.player_fifa_api_id = T1.player_fifa_id WHERE T1.sprint_speed >= 97 AND STRFTIME('%Y', T1.date) BETWEEN '2013' AND '2015'
SELECT T1.name , COUNT(T2.leagueid) FROM League AS T1 JOIN `Match` AS T2 ON T2.leagueId = T1.id GROUP BY T1.name ORDER BY COUNT(T2.leagueid) DESC LIMIT 1;
SELECT AVG(height) FROM Player WHERE birthday BETWEEN '1990-01-01 00:00:00' AND '1995-12-31 23:59:59'
SELECT apiid FROM Player_Attributes WHERE date LIKE '%2010%' AND overall_rating >= ALL(SELECT MAX(overall_rating) * 1.0 - AVG(overall_rating) AS average_above FROM Player_Attributes WHERE date LIKE '%2010%' GROUP BY player_api_id) GROUP BY player_api_id ORDER BY MAX(overall_rating) DESC LIMIT 1
SELECT team_fifa_api_id FROM Team WHERE buildUpPlaySpeed > 50 AND buildUpPlaySpeed < 60
SELECT team_long_name FROM Team_Attributes JOIN player_attributes_team.team ON Team_Attributes.team_api_id=team.id WHERE season='2012/2013' AND buildUpPlayPassing>( SELECT AVG(buildUpPlayPassing) AS avgbupassin2k12 FROM team_attributes JOIN Team_Attributes USING (team_api_id,dates) T1 WHERE strftime('%Y',Team_Attributes.dates) BETWEEN strftime('%Y','2011-08-3') AND strftime('%Y','2012/06')) ) ;
SELECT SUM(IIF(T2.preferred_foot = 'left', 1, 0)) * 100 / COUNT(*) AS per FROM Player AS T1 JOIN Player_Attributes AS T2 ON T1.player_fifa_api_id = T2.player_fifa_api_id WHERE STRFTIME('%Y', T1.birthday) BETWEEN '1987' AND '1992'
SELECT T2.name AS league_name, SUM(T1.home_team_goal + T1.away_team_goal) AS total_goals  FROM `Match` AS T1  JOIN Country_Region AS T3 ON T1.country_id = T3.id  JOIN League AS T2 ON T1.league_id = T2.id  GROUP BY T2.id  ORDER BY total_goals ASC  LIMIT 5;
SELECT AVG(T2.long_shots) FROM Player AS T1 JOIN Player_Statistics AS T2 ON T1.player_fifa_api_id = T2.player_api_id WHERE T1.name = 'Ahmed Samir Farag'
SELECT P2.name  FROM (SELECT T3.player_fifa_api_id, AVG(T3.heading_accuracy) AS avg_heading          FROM Player_Attributes AS T3 GROUP BY T3.player_fifa_api_id) AS T1  JOIN Player AS P2 ON P2.fifa_api_id = T1.player_fifa_api_id  WHERE P2.height > 180  ORDER BY T1.avg_heading DESC LIMIT 10;
SELECT T1.team_long_name FROM Team AS T1 JOIN Team_Attributes AS T2 ON T1.team_api_id = T2.id WHERE T2.buildUpPlayDribblingClass = 'Normal' AND T2.date BETWEEN '2014-01-01 00:00:00' AND '2014-01-31 23:59:59' AND ( SELECT AVG(T3.chanceCreationPassing) FROM Team_Attributes AS T3 WHERE T3.buildUpPlayDribblingClass = 'Normal' AND T3.date BETWEEN '2014-01-01 00:00:00' AND '2014-01-31 23:59:59' ) > T2.chanceCreationPassing ORDER BY T2.chanceCreationPassing DESC LIMIT 6
SELECT T1.name FROM League AS T1 JOIN (SELECT league_id , SUM(home_team_goal) / COUNT(DISTINCT id) home_goal , SUM(away_team_goal) / COUNT(DISTINCT id) away_goal FROM Match WHERE season = '2009/2010' GROUP BY league_id) AS T2 ON T1.id = T2.league_id WHERE T2.home_goal > T2.away_goal
