SELECT Player.apiID FROM Player ORDER BY weight DESC LIMIT 10
SELECT T1.name FROM Player AS T1 JOIN Person AS T2 ON T1.player_name = T2.NAME WHERE (datetime('now','localtime') - datetime(T2.birthday)) BETWEEN '35-0-0' AND '35-11-30';
SELECT Count(MATCH_ID) FROM Goals WHERE PLAYER_NAME = "Aaron Lennon" AND TEAM_HOME_ID = Player.team_id;
SELECT SUM(T2.goals) FROM goal AS T1 JOIN match AS T2 ON T1.match_id  =  T2.match_id WHERE (T1.player_name  =  'Daan Smith' AND T1.team  =  'away') OR (T1.player_name  =  'Filipe Ferreira' AND T1.team  =  'away')
SELECT SUM(T2.home_team_goal) FROM Player AS T1 JOIN Match AS T2 ON T1.team_id  =  T2.home_team JOIN Team AS T3 ON T2.home_team  =  T3.team_id WHERE (datetime('now') - datetime(T1.birthday)) / 365 < 31
SELECT PlayerName FROM Player WHERE overall_rating = ( SELECT max(overall_rating) FROM Player)
SELECT T1.name FROM Player AS T1 JOIN Player_Attributes AS T2 ON T1.player_api_id = T2.player_api_id ORDER BY potential DESC LIMIT 1;
SELECT name FROM Player WHERE attacking_work_rate = 'HIGH'
SELECT T5.name FROM Player AS T5 JOIN ( SELECT * FROM `Match Players` WHERE player >= 1 AND player <= 2 GROUP BY player HAVING AVG(finished) = 1 ) AS T4 ON T4.player = T5.squadNumber ORDER BY strftime('%s', 'now') - strftime('%s', T5.birthday) DESC LIMIT 1
SELECT player_name FROM Player WHERE birth_country= 'Belgium'
SELECT T1.country FROM Player AS T1 JOIN Player_Attributes AS T2 ON T1.player_api_id = T2.player_fifa_api_id WHERE T2.vision > 89 GROUP BY T1.player_name, T1.country
SELECT T1.name AS country FROM Country AS T1 JOIN Player AS T2 ON T1.id = T2.country ORDER BY AVG(T2.weight) DESC LIMIT 1;
SELECT T2.team_long_name FROM Match AS T1 JOIN Team AS T2 ON T1.buildUpPlaySpeedClass = 'Slow' AND T1.home_team_api_id = T2.team_api_id OR T1.away_team_api_id = T2.team_api_id GROUP BY T2.team_long_name
SELECT T2.team_short_name FROM Event AS T1 JOIN Team AS T2 ON T1.match_id = T2.match_id WHERE T1.chanceCreationPassingClass = 'Safe' GROUP BY T1.match_id, T2.team_short_name
SELECT AVG(T3.Height) FROMCountry AS T1 JOIN Player AS T2 ON T1.Country_ID = T2.Country_ID JOIN Player_stats AS T3 ON T2	Player_ID  =  T3.Player_ID WHERE T1.country_name  =  "Italy"
SELECT T2.player_name FROM player AS T1 JOIN Player_Attributes AS T2 ON T1.player_api_id = T2.player_api_id WHERE T1.height > 180 ORDER BY T2.player_name ASC LIMIT 3
SELECT COUNT(*) FROM Players WHERE Player_Name LIKE 'Aaron%' AND Birthday > '1990' ;
SELECT T2.jumping FROM player AS T1 JOIN Player_Attributes AS T2 ON T1.player_api_id = T2.player_fifa_api_id WHERE T1.player_api_id = 6 UNION SELECT T2.jumping FROM player AS T1 JOIN Player_Attributes AS T2 ON T1.player_api_id = T2.player_fifa_api_id WHERE T1.player_api_id = 23 ;
SELECT player_fifa_api_id FROM Player WHERE (SELECT COUNT(*) FROM Player AS Tmp WHERE `潜能` > `potential` AND preferred_foot = '右') < 5 AND preferred_foot = '右' ORDER BY potential LIMIT 5
SELECT COUNT(*) FROM(SELECT * FROM(SELECT p.*, MAX(a.crossing) AS MaxCrossing FROM Player_Attributes AS a JOIN Player AS p ON a.player_api_id=p.player_api_id WHERE p.preferred_foot='left' GROUP BY a.player_api_id ORDER BY MaxCrossing DESC LIMIT 1) AS t1) AS t2 WHERE t2.crossing=t2.MaxCrossing;
SELECT CAST(SUM(CASE WHEN Player_Attributes.stamina > 80 AND Player_Attributes.strength > 80 THEN 1 ELSE 0 END) AS REAL) * 100 / COUNT(*) FROM `Player_Attributes` WHERE `Player_Attributes`.`stamina` IS NOT NULL AND `Player_Attributes`.`strength` IS NOT NULL
SELECT Country FROM League WHERE name = 'Poland Ekstraklasa'
SELECT T1.home_team_goal, T1.away_team_goal FROM `Match` AS T1 INNER JOIN League AS T2 ON T1.league_id = T2.id WHERE T2.name = 'Belgium Jupiler League' AND T1.date LIKE '2008-09-24%'
SELECT sprint_speed ,  agility FROM Player_Attributes WHERE player_name  =  'Alexis Blin' AND acceleration  IS NOT  NULL ORDER BY date DESC LIMIT 1
SELECT buildUpPlaySpeedClass FROM Team WHERE team_long_name  =  'KSV Cercle Brugge' LIMIT 1;
SELECT COUNT(*) FROM `Match` WHERE season = '2015/2016' AND league_id = (SELECT League.id FROM `League` WHERE name='Italian Serie A')
SELECT MAX(T1.home_team_goal) FROM `Match` AS T1 INNER JOIN `home_team_match` AS T2 ON T1.id = T2.match_id WHERE T2.name = 'Netherlands Eredivisie'
SELECT T1.finishing ,  T1.curve FROM Player_Attributes AS T1 JOIN Player AS T2 ON T2.player_api_id = T1.player_api_id WHERE T2.weight = ( SELECT MAX( weight ) FROM Player )  SELECT finishing ,  curve FROM(SELECT *  ,	max_weight := if(@player_weight < weight,@index:= @index+1,@index) as ranking,   @player_weight := weight 	from Player p join (select @index :=0) i  JOIN Player_attributes pa WHERE p.player_api_id = pa.player_api_id AND weight =(SELECT MAX(weight) FROM `Player`)) t WHERE ranking = 1 ;
SELECT L.name FROM(SELECT `League`, COUNT(`Leid`) AS num FROM `Match` WHERE Season  =  '2015/2016' GROUP BY `League` ORDER BY num DESC LIMIT 4) AS T1 JOIN League AS L ON T1.League  =  L.id
SELECT T1.team_long_name FROM Team AS T1 JOIN `Match` AS T2 ON T1.team_api_id = T2.away_team_api_id WHERE T2.away_team_goal = (SELECT MAX(`Match`_away_team_goal) FROM `Match`)
SELECT name FROM Player WHERE overall_rating = (SELECT MAX(overall_rating) FROM Player) LIMIT 1
SELECT SUM(CASE WHEN T3.height < 180 THEN 1 ELSE 0 END) / COUNT(T2.player_fifa_api_ID) * 100 FROM Player_Attributes AS T2 INNER JOIN Player AS T3 ON T2.player_fIFA_API_ID = T3.player_fIFA_API_ID INNER JOIN Team AS T1 ON T1.team_api_id = T2.team_api_id WHERE T2 OVERALL_RATING > 70
SELECT CAST(SUM(IIF(Admission = '+', 1, 0)) AS REAL) / SUM(IIF(SEX = 'M', 1, 0)) FROM Patient GROUP BY SEX HAVING COUNT(CASE WHEN SEX = 'M' THEN ID END) > (SELECT COUNT(ID) FROM `Patient` WHERE Admission = '-')
SELECT CAST(SUM(IIF(strftime('%Y',T2.BirthDay)>'1930',1,0)) AS REAL)*100/SUM(IFNULL(1,0)) FROM `Patient` AS T1 JOIN `Stay` AS T2 ON T1.ID=T2.Patient WHERE T1.Sex='F';
SELECT CAST(SUM(CASE WHEN T2.Admittime IS NOT NULL THEN 1 ELSE 0 END) AS REAL) * 100 / COUNT(T1.ID) FROM Patient AS T1 LEFT JOIN Visit AS T2 ON T1.ID = T2.Patient_ID WHERE STRFTIME('%Y',T1.Birthdate) BETWEEN '1930' AND '1940';
SELECT CAST(T1.c AS REAL) / T2.c FROM ( SELECT COUNT(DISTINCT T_ADMISSIONS.ID) AS c FROM ADMISSIONS JOIN PATIENT ON ADMISSIONS.PID = PATIENT.ID WHERE T_ADMISSIONS.ADMITDT LIKE '+%' AND T_PATIENT.DIAGNOSIS = 'SLE' GROUP BY DIAGNOSIS ) AS T1, ( SELECT COUNT(DISTINCT T_ADMISSIONS.ID) AS c FROM ADMISSIONS JOIN PATIENT ON admissions.pid = patient.id WHERE admissions.ADMITDT LIKE '-%' AND t_patient.DIAGNOSIS = 'SLE' GROUP BY DIAGNOSIS ) AS T2
