SELECT CAST((SUM(CASE WHEN T2.Birthday = '1959-02-18 00:00:00' AND strftime('%Y-%m', T2.Date) = '1981-11' THEN T2.[T-CHO] ELSE 0 END) - SUM(CASE WHEN T2.Birthday = '1959-02-18 00:00:00' AND strftime('%Y-%m', T2.Date) = '1981-12' THEN T2.[T-CHO] ELSE 0 END)) AS REAL) * 100 / SUM(CASE WHEN T2.Birthday = '1959-02-18 00:00:00' AND strftime('%Y-%m', T2.Date) = '1981-11' THEN T2.[T-CHO] ELSE 0 END) FROM `Patient` AS T1 INNER JOIN `Laboratory` AS T2 ON T1.ID = T2.ID
