SELECT Segment  FROM yearmonth  JOIN customers ON yearmonth.CustomerID = customers.CustomerID  GROUP BY Segment  ORDER BY SUM(Consumption) ASC  LIMIT 1;
SELECT substr(`Date`,1,4) AS Year , SUM(`Consumption`) AS Total_Consumption  FROM `yearmonth`  WHERE `CustomerID` IN  	(SELECT `CustomerID`      FROM `customers`      WHERE `Currency` = 'CZK')  GROUP BY substr(`Date`,1,4)  ORDER BY Total_Consumption DESC  LIMIT 1
SELECT T2.Date  FROM customers AS T1  JOIN yearmonth AS T2 ON T1.CustomerID = T2.CustomerID  WHERE T1.Segment = 'SME' AND SUBSTR(T2.Date, 1, 4) = '2013'  ORDER BY Consumption DESC  LIMIT 1;
WITH AnnualConsumption AS (     SELECT CustomerID, SUM(Consumption) as TotalConsumption      FROM yearmonth     WHERE SUBSTR(Date,1,4) = '2013'     GROUP BY CustomerID), LowestConsumingCustomers AS(    SELECT Segment, MIN(TotalConsumption) OVER (PARTITION BY Segment) AS Minconsumption    FROM ( 	   SELECT c.Segment, 	   ac.TotalConsumption     	FROM AnnualConsumption ac     	INNER JOIN customers c ON ac.CustomerID = c.CustomerID)), FinalTable as( 	SELECT Segment,CustomerID,COUNT(*)as CustomersWithLeastCons, 	TotalConsumption ,Minconsumption 	 from AnnualConsumption ac         INNER JOIN customers c on ac.CustomerID=c.CustomerID             inner join LowestConsumingCustomers lc on lc.Minconsumption=ac.TotalConsumption 	group by  segment,customerid order by Segment ) SELECT  (CASE WHEN Segment = 'SME' THEN TotalConsumption ELSE null END-CASE WHEN Segment='LAM' THEN TotalConsumption ELSE null END) AS SMEvsLAM,DifferenceSMEvsKAM=DISTINCT(CASE WHEN Segment = 'SME' THEN TotalConsumption END- CASE WHEN Segment='KAM' THEN TotalConsumption  ELSE null END) ,  (CASE WHEN Segment = 'LAM' THEN TotalConsumption ELSE null  END-CASE WHEN Segment='KAM' THEN TotalConsumption ELSE null END )as LAMvsKAML from finalTable  group by segment order by segment ; 
SELECT T.segment, (((T.sum_2013 - T.sum_2012) / T.sum_2013) * 100) AS Percentage_Increase  FROM (     SELECT C.Segment,     (SELECT SUM(YM.Consumption) FROM yearmonth YM WHERE YM.Date LIKE '2013%' AND YM.CustomerID = C.CustomerID) as sum_2013,     (SELECT SUM(YM.Consumption) FROM yearmonth YM WHERE YM.Date LIKE '2012%' AND YM.CustomerID = C.CustomerID) as sum_2012     FROM customers C     ) T WHERE T.Segment IN ('SME', 'LAM', 'KAM') GROUP BY T.segment ORDER BY Percentage_Increase DESC, Percentage_Increase ASC
SELECT SUM(Consumption)  FROM yearmonth  WHERE CustomerID = 6 AND        Date BETWEEN '201308' AND '201311';
SELECT ( SELECT COUNT(*) FROM `gasstations` WHERE `Country` = 'CZE' AND `Segment` = 'discount' ) - ( SELECT COUNT(*) FROM `gasstations` WHERE `Country` = 'SVK' AND `Segment` = 'discount' );
SELECT (SELECT Consumption FROM yearmonth WHERE CustomerID = 7 AND Date = '201304') - (SELECT Consumption FROM yearmonth WHERE CustomerID = 5 AND Date = '201304') AS difference;
SELECT COUNT(T1.CustomerID) AS czk_sme_count,         (SELECT COUNT(CustomerID) FROM customers WHERE Segment = 'SME' AND Currency = 'CZK') -         (SELECT COUNT(CustomerID) FROM customers WHERE Segment = 'SME' AND Currency = 'EUR') AS more_smes_czk_than_eur FROM customers T1 WHERE T1.Currency = 'CZK' AND T1.Segment = 'SME';
SELECT customer.CustomerID  FROM customers AS customer  JOIN `yearmonth` AS consumption ON customer.CustomerID = consumption.CustomerID WHERE customer.Currency = 'EUR' AND customer.Segment = 'LAM' AND consumption.Date = '201310' ORDER BY consumption.Consumption DESC LIMIT 1;
SELECT `customers.CustomerID`, SUM(`transactions_1k.Amount`) AS TotalConsumption  FROM `transactions_1k` JOIN `customers` ON `transactions_1k.CustomerID` = `customers.CustomerID` GROUP BY `customers.CustomerID` ORDER BY TotalConsumption DESC LIMIT 1;
SELECT SUM(Consumption)  FROM `yearmonth`  JOIN customers ON `yearmonth`.CustomerID = customers.CustomerID  WHERE `yearmonth`.Date = '201305' AND customers.Segment = 'KAM';
 WITH LamCustomersTotal AS ( 	SELECT COUNT(*) AS lamCustomerCount  	FROM `customers`	 	WHERE Segment = 'LAM' ), LamCustomersAboveValue AS ( 	SELECT COUNT(*) AS lamConsumptionAbove_46_73 	FROM `yearmonth` 	INNER JOIN `customers` ON `yearmonth`.CustomerID = `customers`.CustomerID 	WHERE `customers`.`Segment` = 'LAM' AND Consumption > 46.73  )  SELECT CAST(LamCustomersAboveValue.lamConsumptionAbove_46_73 AS REAL) * 100 / LamCustomersTotal.lamCustomerCount AS Percent_lamCustomerIdConsumeMoreThan_46_73 FROM LamCustomersTotal, LamCustomersAboveValue     
SELECT Country, COUNT(*) AS Total_Value_For_Money_Stations FROM `gasstations` WHERE `Segment` = 'Value for money' GROUP BY Country ORDER BY Total_Value_For_Money_Stations DESC LIMIT 1;
SELECT      (COUNT(CASE WHEN T2.Currency = 'EUR' THEN 1 END) * 100.0 / COUNT(*)) FROM     customers AS T2 JOIN     transactions_1k AS T1 ON T1.CustomerID = T2.CustomerID WHERE     T2.Segment = 'KAM';
SQL SELECT      (COUNT(*) * 100.0) / (SELECT COUNT(*) FROM customers) AS percentage_customers FROM      yearmonth JOIN customers ON customers.CustomerID = yearmonth.CustomerID WHERE      SUBSTR(yearmonth.Date, 1, 4) = '2012' AND     CAST(SUBSTR(yearmonth.Date, 5, 2) AS INTEGER) = 2 AND     yearmonth.Consumption > 528.3; 
SELECT      (COUNT(CASE WHEN Segment='Premium' THEN GasStationID END) * 1.0 / COUNT(GasStationID)) * 100 AS PercentageOfPremium FROM gasstations WHERE Country = 'Slovakia';
SELECT CustomerID, SUM(Consumption) AS Total_Consumption FROM yearmonth WHERE Date = '201309' GROUP BY CustomerID ORDER BY Total_Consumption DESC LIMIT 1; 
SELECT `customers`.`Segment`, SUM(`yearmonth`.`Consumption`) AS Total_Consumption FROM `customers` JOIN `yearmonth` ON `customers`.`CustomerID` = `yearmonth`.`CustomerID` WHERE `yearmonth`.`Date` = '201309' GROUP BY `customers`.`Segment` ORDER BY Total_Consumption ASC LIMIT 1;
;
SELECT MAX(Consumption) FROM yearmonth   WHERE SUBSTR(Date,1,4) = '2012'; 
SELECT MAX(yearday.Consumption)  FROM yearmonth AS yearday  JOIN customers AS cust  ON yearday.customerID = cust.CustomerID WHERE cust.Currency = 'EUR' 
SELECT Description FROM products WHERE ProductID IN (SELECT ProductID FROM transactions_1k WHERE STRFTIME('%Y%m', Date) = '201309')
SELECT DISTINCT T2.Country FROM `transactions_1k` AS T1 JOIN `gasstations` AS T2 ON T1.GasStationID = T2.GasStationID WHERE strftime('%Y%m', T1.Date) = '201306'
SELECT DISTINCT gs.ChainID FROM gasstations gs JOIN transactions_1k t ON gs.GasStationID = t.GasStationID JOIN customers c ON t.CustomerID = c.CustomerID WHERE c.Currency = 'EUR'
SELECT T3.Description FROM customers AS T1 JOIN transactions_1k AS T2 ON T1.CustomerID = T2.CustomerID JOIN products AS T3 ON T2.ProductID = T3.ProductID WHERE T1.Currency = 'EUR'
SELECT AVG(T1.Price * T1.Amount) FROM `transactions_1k` AS T1 WHERE strftime('%Y-%m', T1.Date) = '2012-01'
